        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eA Picture-with-implicit-context object. \n\u003c/p\u003e\u003cp\u003eThis is the corresponding type to Picture in the Wumpus-Core.\n\u003c/p\u003e\u003cp\u003eNote - many of the composition functions are in \n \u003cem\u003edestructor form\u003c/em\u003e. As Wumpus cannot make a Picture from an \n empty list of Pictures, \u003cem\u003edestructor form\u003c/em\u003e decomposes the \n list into the \u003ccode\u003ehead\u003c/code\u003e and \u003ccode\u003erest\u003c/code\u003e as arguments in the function \n signature, rather than take a possibly empty list and have to \n throw an error.\n\u003c/p\u003e\u003cp\u003eTODO - PosImage no longer supports composition operators, so \n better names are up for grabs...\n\u003c/p\u003e\u003c/div\u003e",
