        "fct-descr": "\u003cp\u003e\u003ccode\u003e\u003ca\u003eprojectAnchor\u003c/a\u003e\u003c/code\u003e : \u003ccode\u003e extract_func * dist * object -\u003e Point \u003c/code\u003e\n\u003c/p\u003e\u003cp\u003eDerive a anchor by projecting a line from the center of an \n object through the intermediate anchor (produced by the \n extraction function). The final answer point is located along\n the projected line at the supplied distance \u003ccode\u003edist\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eE.g. take the north of a rectangle and project it 10 units \n further on:\n\u003c/p\u003e\u003cpre\u003e projectAnchor north 10 my_rect\n\u003c/pre\u003e\u003cp\u003eIf the distance is zero the answer with be whatever point the \n the extraction function produces.\n\u003c/p\u003e\u003cp\u003eIf the distance is negative the answer will be along the \n projection line, between the center and the intermediate anchor.\n\u003c/p\u003e\u003cp\u003eIf the distance is positive the anchor will be extend outwards \n from the intermediate anchor.\n\u003c/p\u003e",
