        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eImport shim for \u003ccode\u003eWumpus.Basic.Kernel\u003c/code\u003e modules.\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003eKernel.Base\u003c/code\u003e - low-level objects, general enumerations, unit \n and \u003ccode\u003eDrawingContext\u003c/code\u003e support. \u003ccode\u003eDrawingContext\u003c/code\u003e is comparative \n to the \u003cem\u003egraphics state\u003c/em\u003e in PostScript, but it is a read-only\n environment (cf. the Reader monad). Like the Reader monad it \n supports branching update through \u003ccode\u003elocal\u003c/code\u003e - here called \n \u003ccode\u003elocalize\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003eKernel.Objects\u003c/code\u003e - \"elementary\" drawing objects, plus some \n catalogues of named, predefined drawing objects \n (DrawingPrimitives) and useful operations (named vectors - \n Displacement).\n\u003c/p\u003e\u003cp\u003e\u003ccode\u003eKernel.Drawing\u003c/code\u003e - \"collective\" drawing objects. \u003ccode\u003eDrawing\u003c/code\u003e is \n considered a higher layer than \u003ccode\u003eObjects\u003c/code\u003e, so there should be \n dependencies only from \u003ccode\u003eDrawing\u003c/code\u003e to \u003ccode\u003eObjects\u003c/code\u003e.\n\u003c/p\u003e\u003c/div\u003e",
        "fct-module": "Wumpus.Basic.Kernel",
